import React from "react";
import dropdown from "../../resource/drop-down-filter.svg";

function FilterButton() {
    return (
        <button className="flex gap-2 justify-center items-center self-stretch px-6 py-3 bg-white border border-black border-solid rounded-xl w-[104px]">
            <span className="self-stretch">Filter by Lab</span>
            <img
                loading="lazy"
                src={dropdown}
                alt=""
                className="object-contain shrink-0 w-6 aspect-square"
            />
        </button>
    );
}

export default FilterButton;
